import React from 'react'
import {Link} from 'react-router-dom'
import { StyledButton, StyledLogInButton, StyledLogOutButton, StyledCreateButton } from '../Style/StyledButtons'

export default function Button({label, path, del, logOut, to, create, login}) {
    return (
        <>
            {login && 
            <StyledLogInButton login={true}>
                <Link to={path}>
                    {label}
                </Link>
            </StyledLogInButton>
            }
            
            {del && 
            <StyledButton onClick={del}>
                    {label}
            </StyledButton>
            }

            {logOut && 
            <StyledLogOutButton logOut={true}>
                <Link to={to}>
                    {label}
                </Link>
            </StyledLogOutButton>
            }
            {create && 
                    <StyledCreateButton create={true}>
                        <Link to={to}>
                            {label}
                </Link>
                    </StyledCreateButton>
            }

            
        </>
    )
}
